  false,\n\t\"url\": null,\n\t\"notes\": \"Aquatic vegetation in Volusia County. DEP
  SEA_GRASSES This polygon GIS data set represents a compilation of statewide seagrass
  data from various source agencies and scales. The data sources were mapped from
  photography ranging in date from 1987 to 1999. The original source data sets were
  not all classified in the same manner; some used the Florida Land Use Cover and
  Forms Classification System (FLUCCS) codes 9113 for discontinuous seagrass and 9116
  for continuous seagrass; some defined only presence and absence of seagrass, and
  some defined varying degrees of seagrass percent cover. In order to merge all of
  these data sources into one compilation data set, FMRI reclassified the various
  source data attribute schemes into two categories: \"continuous\" and \"discontinuous\"
  seagrass. Source: FWC-FMRI (Florida Fish and Wildlife Conservation Commission-Florida\",\n\t\"owner_org\":
